import React from 'react';
import logo from './icons8-apple-logo.svg'
import {Link} from 'react-router-dom'
import {AiFillHome} from 'react-icons/ai'
import {BsPersonDashFill} from 'react-icons/bs'
const Navbar = ({show}) => {
    return (
        <div className={show ? 'sidenav active' : 'sidenav'}>
            <img className="logo" src={logo} alt=""/>
            <ul>

                <li><Link to='/'><AiFillHome/>Home</Link></li>
                <li><Link to='/about'><BsPersonDashFill/>About us</Link></li>
                <li><Link to='/contact'><BsPersonDashFill/>Contact</Link></li>
            </ul>
        </div>
    );
};

export default Navbar;
